import React from 'react';
import { cpus } from 'os';

const Card = (props) => {
    const cWidth = 485;
    const cHeight = 300;
    const cPadding = 10;
    const cHeadFoot = 0.1;

    return (
        <div class="card text-center bg-light mb-3">
            <div class="card-body">
                <h5 class="card-header">Card Title</h5>
                <p class="card-text">Card Description</p>
                <a href="#" class="btn btn-primary">button link</a>
                <div class="card-footer text-muted">card footer</div>
            </div>
        </div>
    )
}

export default Card;
